import React from 'react'
import styled from 'styled-components';

const preto = "#000000";
const cinza = "#d3d3d3";


export const DivCar = styled.div`
    font-size: 2rem;
    background-color: ${cinza};
    padding:0;
    margin:10px;
    
    ul {
        margin:0;
        padding:0;
    }
    
    li {
        display: inline-block;
        text-decoration: none;
        color: ${preto};
        background-color: ${cinza};
        text-align: center;
        padding:3px;
        margin-left:15px
    }   
`;

const Carros = (props) => {
    return (
        
        <DivCar>         
            <nav>
                <ul>
                    <li>{props.children}</li> 
                </ul>
            </nav>
        </DivCar>
      
    );
}
export default Carros;
